    }, 200);
    
    window.cn1LoadedFile = function(filename) {
        if (filename.indexOf('?') >= 0) {
            filename = filename.substring(0, filename.indexOf('?'));

window.Base64ToBlob = function(dataURL) {
  var BASE64_MARKER = ';base64,';
  if (dataURL.indexOf(BASE64_MARKER) == -1) {
    var parts = dataURL.split(',');
    var contentType = parts[0].split(':')[1];
    var raw = decodeURIComponent(parts[1]);

    return new Blob([raw], {type: contentType});
  }

  var parts = dataURL.split(BASE64_MARKER);
  var contentType = parts[0].split(':')[1];
  var raw = window.atob(parts[1].replace(/\n/g,''));
  var rawLength = raw.length;

  var uInt8Array = new Uint8Array(rawLength);

  for (var i = 0; i < rawLength; ++i) {
    uInt8Array[i] = raw.charCodeAt(i);
  }

  return new Blob([uInt8Array], {type: contentType});
};

  results = regex.exec( window.location.search );

    return "";

    return decodeURIComponent(results[1].replace(/\+/g, " "));
  }
};

  reader.readAsDataURL(blob);

    onload(reader.result);
  };
};

window.arrayBufferToBase64 = function(buffer){
    var binary = '';
    var bytes = new Uint8Array( buffer );
    var len = bytes.byteLength;
    for (var i = 0; i < len; i++) {
        binary += String.fromCharCode( bytes[ i ] );
    }
    return window.btoa( binary );
};

    function capturePhotoWithFileButton(callback, targetWidth, targetHeight){
        var fileBtn = $('<input id="cn1-image-picker" type="file" accept="image/*" />');
        var dialog = document.createElement('div');
        dialog.appendChild(fileBtn.get(0));
        dialog.className = 'cn1-capture-dialog';

        document.querySelector('body').appendChild(dialog);
        fileBtn.change(function(event){
            var files = event.target.files;
            if (files.length>0){
            
                var reader = new FileReader();
                var img = $('<img>').get(0);
                $(img).on('load', function(){
                    $(dialog).fadeOut(100, function(){
                        dialog.parentNode.removeChild(dialog);
                    });
                    var width=targetWidth;
                    var height=targetHeight;
                    if (width<img.naturalWidth){
                        height=height*width/img.naturalWidth;
                        width=img.naturalWidth;
                    }
                    if (height<img.naturalHeight){
                        width=width*height/img.naturalHeight;
                        height=img.naturalHeight;
                    }
                    var outCanvas = document.createElement('canvas');
                    outCanvas.setAttribute('width', width);
                    outCanvas.setAttribute('height', height);
                    var ctx = outCanvas.getContext('2d');
                    ctx.drawImage(img, 0, 0, width, height);
                    callback(outCanvas);
                });
                $(img).on('error', function(){
                    console.log('Error loading image');
                    $(dialog).fadeOut(100, function(){
                        dialog.parentNode.removeChild(dialog);
                    });
                    callback(null);
                });
                reader.onload = function(e){
                    img.src=e.target.result;
                };
                reader.readAsDataURL(files[0]);
                
                
            }
        });
    }

         * Step one: run a function on load (or whenever is appropriate for you)
         * Function run on load sets up the service worker if it is supported in the
         * browser. Requires a serviceworker in a `sw.js`. This file contains what will
         * happen when we receive a push notification.
         * If you are using webpack, see the section below.
         */

                navigator.serviceWorker.register('sw.js').then(initialiseState);

                console.warn('Service workers are not supported in this browser.');
                onFail('Service workers are not supported in this browser.');

                  var data = event.data.data;
                  data.visual = event.data.visual;
                  onPush(data);
              }
            });
            //console.log(registration);
            var serviceWorker;
            
            if (registration.installing) {
                serviceWorker = registration.installing;

            } else if (registration.waiting) {
                serviceWorker = registration.waiting;

            } else if (registration.active) {
                serviceWorker = registration.active;
                
            }

                if (serviceWorker.state === 'activated') {
                    //console.log("Controller is "+serviceWorker.controller);
                    serviceWorker.postMessage("a message");

                serviceWorker.addEventListener('controllerchange', function (e) {
                    //console.log("Controller changed");
                });
                serviceWorker.addEventListener('message', function(event) {
                  //console.log('Received a message from service worker: ', event.data);
                  if (event.data.type == 'push') {
                      var data = event.data.data;
                      data.visual = event.data.visual;
                      onPush(data);
                  }
                  
                });

            // permission back on. In this statement you could show some UI element

                            }
                        });
